import React, { Component } from 'react'
import './HeaderLayout.scss';
export default class HeaderComponent extends Component {
  render() {
    return (
      <div>
        <header>
          <div className="search">
            <input
              className="searchBox"
              type="text"
              placeholder="Search"
              position ="relative"
            />
            <input className = "searchSubmit" type="submit" position ="relative"
 />

          </div>
        </header>
      </div>
    )
  }
}
